  true,\n\t\"url\": null,\n\t\"notes\": \"This API is designed to find the rankings
  by geography within the state for a specific metric (population or household) and
  rank (any of the metrics from provider, demographic, technology or speed). The results
  are the top ten and bottom ten records within the state for the particular geography
  type and my area rankings. Additionally we include +/- 5 rankings from the 'my'
  area rank.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
